import React from 'react';
import Highcharts from 'highcharts';
import axios from 'axios';
import HighchartsReact from 'highcharts-react-official';
import drilldown from 'highcharts/modules/drilldown';
import PageHeader from '../PageHeader/PageHeader';
const finnhub = require('finnhub');

function MainPage(props) {

    const options = {
        series: [{
            name: 'profit',
            data: [10,30,50,70,100,150,180]
        }]
    }
    drilldown(Highcharts);

    const {logoutHandler} = props;

    const api_key = finnhub.ApiClient.instance.authentications['api_key'];
    api_key.apiKey = "bu6v0ff48v6rghl7mpc0";
    const finnhubClient = new finnhub.DefaultApi()

    finnhubClient.stockCandles("AAPL", "D", 1590988249, 1591852249, {}, (error, data, response) => {
        console.log(data)
    });

    finnhubClient.cryptoCandles("BINANCE:BTCUSDT", "D", 1590988249, 1591852249, (error, data, response) => {
        console.log(data)
    });

    finnhubClient.cryptoExchanges((error, data, response) => {
        console.log(data)
    });

    return (
    <>
    <PageHeader logoutHandler={logoutHandler} />
     <main>
         <section>
             <HighchartsReact highcharts={Highcharts} options={options} />


         </section>
     </main>
     </>
    )
}

export default MainPage
